$(function() {
	//Список преимуществ
	$('.js-show-more').on('click', function(e){
		e.preventDefault();

		$('.columns').toggleClass('show-more');

		if ($('.columns.show-more').length) {
			$(this).text('Свернуть список');
		} else {
			$(this).text('Все преимущества');
		}
	})

	//Выбор карты на мобилке
	$('.js-select-gold').on('click', function(e){
		e.preventDefault();

		$('.columns').removeClass('select-classic');
		$('.columns').addClass('select-gold');
		$('.columns__button--m').text('ОФОРМИТЬ КАРТУ GOLD').data('card','gold');
	})
	$('.js-select-classic').on('click', function (e) {
		e.preventDefault();

		$('.columns').addClass('select-classic');
		$('.columns').removeClass('select-gold');
		$('.columns__button--m').text('ОФОРМИТЬ КАРТУ CLASSIC').data('card','standard');
	})

	//Изменение максимальной высоты списка
	$(window).on('resize', changeMaxHeight);

	changeMaxHeight();

	function changeMaxHeight() {
		var listLeft = $('.columns__left .columns__item').not('.columns__item--more'),
			listRight = $('.columns__right .columns__item').not('.columns__item--more'),
			listCenterGold = $('.columns__center .columns__list--gold .columns__item').not('.columns__item--more'),
			listCenterClassic = $('.columns__center .columns__list--classic .columns__item').not('.columns__item--more'),
			heightR = 0,
			heightL = 0,
			heightGold = 0,
			heightClassic = 0;

			listLeft.each(function(){
				heightL += $(this).outerHeight(true);
			})

			listRight.each(function () {
				heightR += $(this).outerHeight(true);
			})

			listCenterGold.each(function(){
				heightGold += $(this).outerHeight(true);
			})

			listCenterClassic.each(function () {
				heightClassic += $(this).outerHeight(true);
			})
			
		//desctop
		if (heightL > heightR) {
			$('.columns--d .columns__list').css('max-height', heightL + 'px');
		} else {
			$('.columns--d .columns__list').css('max-height', heightR + 'px');
		}

		//mobile
		if (heightGold > heightClassic) {
			$('.columns--m .columns__list').css('max-height', heightGold + 'px');
		} else {
			$('.columns--m .columns__list').css('max-height', heightClassic + 'px');
		}
	}

	//Parallax эффект у карт
	parallax('.header', [{ obj: '.cards__gold', mov: '-40' },{ obj:'.cards__standard', mov: '-20' }]);

	//Parallax эффект на последнем слайде
	parallax('.buy', [{ obj: '.phone__card', mov: '-40' }, { obj: '.phone__phone', mov: '-20' }]);

	//Заявка
	$('.js-checkout').on('click', function () {
		$('body').addClass('modal-opened');
		var postfix = '?' + window.location.search.substring(1).split("&").join("&"),
			cardType = $(this).data('card');

		//console.log(postfix);

		if (cardType == 'gold') {
			iframe_src = 'https://form.unicreditbank.ru/ru/personal/banking/packages-app-embed-mastercard-gold.html' + postfix;
		}
		if (cardType == 'standard') {
			iframe_src = 'https://form.unicreditbank.ru/ru/personal/banking/packages-app-embed-mcs.html' + postfix;
		}

		$('#modal-iframe').prop('src', iframe_src);
	});

	$('.js-close-modal').on('click', function (e) {
		e.preventDefault();

		$('body').removeClass('modal-opened');
	})
	
	

	//-----------------------------------

	//Обновить страницу при ресайзе
	// var resize = true,
	// 	windowWidth = $(window).width();

	// $(window).on('resize', function () {
	// 	if (resize && $(window).width() != windowWidth) {
	// 		window.location.href = window.location.href;

	// 		resize = false;
	// 	}
	// })

	function parallax(obj, targets) {
		var timeout;
		$(obj).mousemove(function (e) {
			if (timeout) clearTimeout(timeout);
			setTimeout(callParallax.bind(null, e), 200);

		});

		function callParallax(e) {
			targets.forEach(function(target) {
				parallaxIt(e, target.obj, target.mov);
			})
		}

		function parallaxIt(e, target, movement) {
			var $this = $(obj);
			var relX = e.pageX - $this.offset().left;
			var relY = e.pageY - $this.offset().top;

			TweenMax.to(target, 1, {
				x: (relX - $this.width() / 2) / $this.width() * movement,
				y: (relY - $this.height() / 2) / $this.height() * movement,
				ease: Power2.easeOut
			})
		}
	}

	//Градиент

	var colors = new Array(
		[16, 11, 49],
		[30, 51, 133],
		[22, 15, 65],
		[40, 11, 77]);

	var step = 0;
	//color table indices for: 
	// current color left
	// next color left
	// current color right
	// next color right
	var colorIndices = [0, 1, 2, 3];

	//transition speed
	var gradientSpeed = 0.002;

	function updateGradient() {

		if ($ === undefined) return;

		var c0_0 = colors[colorIndices[0]];
		var c0_1 = colors[colorIndices[1]];
		var c1_0 = colors[colorIndices[2]];
		var c1_1 = colors[colorIndices[3]];

		var istep = 1 - step;
		var r1 = Math.round(istep * c0_0[0] + step * c0_1[0]);
		var g1 = Math.round(istep * c0_0[1] + step * c0_1[1]);
		var b1 = Math.round(istep * c0_0[2] + step * c0_1[2]);
		var color1 = "rgb(" + r1 + "," + g1 + "," + b1 + ")";

		var r2 = Math.round(istep * c1_0[0] + step * c1_1[0]);
		var g2 = Math.round(istep * c1_0[1] + step * c1_1[1]);
		var b2 = Math.round(istep * c1_0[2] + step * c1_1[2]);
		var color2 = "rgb(" + r2 + "," + g2 + "," + b2 + ")";

		$('.background').css({
			background: "-webkit-gradient(linear, left top, right top, from(" + color1 + "), to(" + color2 + "))"
		}).css({
			background: "-moz-linear-gradient(left, " + color1 + " 0%, " + color2 + " 100%)"
		});

		step += gradientSpeed;
		if (step >= 1) {
			step %= 1;
			colorIndices[0] = colorIndices[1];
			colorIndices[2] = colorIndices[3];

			//pick two new target color indices
			//do not pick the same as the current one
			colorIndices[1] = (colorIndices[1] + Math.floor(1 + Math.random() * (colors.length - 1))) % colors.length;
			colorIndices[3] = (colorIndices[3] + Math.floor(1 + Math.random() * (colors.length - 1))) % colors.length;

		}
	}

	setInterval(updateGradient, 10);
	
	//Кнопка Оформить карту на первом экране
	$('.js-p-action-open').on('click', function(e) {
		e.preventDefault();

		$('body').addClass('p-action-show');
	})

	//Закрыть попап
	$('.js-p-action-close').on('click', function(e) {
		e.preventDefault();

		$('body').removeClass('p-action-show');
	})
	$('body').on('click', function (e) {
		if ($(e.target).hasClass('p-action__wrapper')) {
			$('body').removeClass('p-action-show');
		}
	})
});

$(window).on('load', init);

function init() {
	$('html, body').animate({ scrollTop: 0 }, 100)
	//Прелоадер
	$('.loader').hide();

	//Анимации
	cardsAnimate()
	enterFirst();
}

function enterFirst() {
	//Анимация появления элементов на первом слайде
	var slide1 = new TimelineMax();

	slide1
		.add('start')
		.to('.header__top', 1.5, {
			transform: 'translateY(0)',
			opacity: 1
		}, 'start')
		.from('.banner__title', 1.5, {
			transform: 'translateY(-50px)',
			opacity: 0
		}, 'start')
		.from('.banner__text', 1.5, {
			transform: 'translateY(-50px)',
			opacity: 0
		}, 'start')
		.from('.banner__item:first-child', 1.5, {
			transform: 'translateY(-50px)',
			opacity: 0
		}, 'start+=0.5')
		.from('.banner__item:last-child', 1.5, {
			transform: 'translateY(-50px)',
			opacity: 0
		}, 'start+=0.8')
		.from('.circle', 1.5, {
			//transform: 'translateY(-50px) scale(0.8)',
			opacity: 0
		}, 'start+=1')
}

function cardsAnimate() {
	// init controller
	var controller = new ScrollMagic.Controller({});

	var waves = new TimelineMax();

	waves
		.add('start')
		.to($('.wave1, .wave1_2, .wave1_3'), 5, {
			attr: {
				d: 'M 0 480 C 200 480 280 480 480 480 C 680 480 760 480 1000 480 C 1240 480 1360 480 1600 480 C 1800 480 1840 480 1920 480'
			}
		}, 'start')
		.to($('.wave2, .wave2_2, .wave2_3'), 5, {
			attr: {
				d: 'M 0 480 C 80 480 240 480 480 480 C 720 480 760 480 1000 480 C 1240 480 1280 480 1480 480 C 1720 480 1840 480 1920 480'
			}
		}, 'start')
		.to($('.back'), 5, {
			attr: {
				d: 'M 0 480 Q 80 480 240 480 C 520 480 560 480 800 480 C 1000 480 1080 480 1320 480 C 1600 480 1640 480 1920 480 L 1920 2000 L 0 2000 Z'
			}
		}, 'start')

	var waves = new ScrollMagic.Scene({ triggerElement: ".get", duration: '50%', triggerHook: 'onLeave' })
		.setTween(waves)
		.addTo(controller);

	var fourthEnter = new TimelineMax();

	fourthEnter
		.set($('.get__item'), {
			transform: 'translateY(-20px)',
			opacity: 0
		})
		.set($('.get__text, .get__title'), {
			opacity: 0
		})
		.to($('.get__text, .get__title'), 1, {
			opacity: 1
		})

		.to($('.get__item--1'), 1 / 2, {
			transform: 'translateY(0px)',
			opacity: 1
		}, '-=0.7')
		.to($('.get__item--2'), 1 / 2, {
			transform: 'translateY(0px)',
			opacity: 1
		}, '-=0.2')
		.to($('.get__item--3'), 1 / 2, {
			transform: 'translateY(0px)',
			opacity: 1
		}, '-=0.2')


	//Анимация слайда Как получить
	var get = new ScrollMagic.Scene({ triggerElement: ".get__container", duration: "0" })
		.setTween(fourthEnter)
		.addTo(controller);

	var fifthEnter = new TimelineMax();

	fifthEnter
		.set($('.rates__text, .rates__title'), {
			opacity: 0
		})
		.to($('.rates__text, .rates__title'), 1, {
			opacity: 1
		}, '+=0.5')
		.to($('.rate'), 1, {
			opacity: 1
		}, '-=0.2')

	fifthEnter.eventCallback("onComplete", function() {
		
	});

	//Parallax эффект условия
	$('.rate__wrap').each(function(){
		$(this).tilt({
			maxTilt: 2,
			disableAxis: 'x'
		})
	})
	
	//Анимация слайда Условия
	var rates = new ScrollMagic.Scene({ triggerElement: ".rates__container", duration: "0", triggerHook: "0.9" })
		.setTween(fifthEnter)
		.addTo(controller);

	var sixthEnter = new TimelineMax();

	sixthEnter
		.add('start')
		.set('.phone__card, .phone__shadow', {
			transform: 'translateY(-150px)',
			opacity: 0
		})
		.to('.phone__card, .phone__shadow', 1, {
			transform: 'translateY(0px)',
			opacity: 1
		}, '+=0.5')
		.to('.phone__phone', 1, {
			transform: 'translateY(0px)',
			opacity: 1
		}, 'start')

	//Анимация слайда Совершайте покупки
	var rates = new ScrollMagic.Scene({ triggerElement: ".buy__container", duration: "0", triggerHook: "0.6" })
		.setTween(sixthEnter)
		.addTo(controller);

	sixthEnter.eventCallback("onStart", function () {
		//Анимация отрисовки телефона
		var myVivus;

		myVivus = new Vivus('phone', { duration: 100 });

		myVivus.play(1);
	});
}
